import { Formik,Form,Field } from "formik";
import React from "react";
import ReactDOM from "react";
import { Container, Row } from "react-bootstrap";

const UserLoginPage = (props) => {
    return ( 
        <div>
            <Formik
            initialValues={{
                userName:'',
                password:'',
            }}
            onSubmit= {(event) => props.activeUserCheck({userName:event.userName,password:event.password})}
            >
                <Form>
                 <label htmlFor="userName">User Name</label>
                 <Field id='userNameField' name='userName' placeholder='Enter User Name' />

                 <label htmlFor="password">Password</label>
                 <Field id='passwordField' name='password' placeholder='Enter Password' />

                <button type='submit'>Sign In</button>
                </Form>
            </Formik>

            <Container>
                <Row>
                    <p>Here are some logins to try out different profiles! In the future you will be able to make your own profile <b/>
                        username: soccerfan1 password: password1
                    </p>
                </Row>
            </Container>
        </div>
    )
} 

export default UserLoginPage
